import React from "react"

const Footer = (props) => {
  return (
    <footer>
      <div className="footer-copyright">
        <div className="container grey-text text-darken-3">
          <small>&copy; 2019 A.DeCarvalho</small>
        </div>
      </div>
    </footer>
  )
}

export default Footer
